import React, {useEffect} from "react";
import { Container, Row } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import s from "./Header.module.css";

const Header = ({isLoggedIn, setIsLoggedIn}) => {
  const handleLogOut = () => {
    setIsLoggedIn(false);
  };



  use

  function isAdmin(){
    let a = 5;
    if(a==5){
      return (
      
        <NavLink
        className={`nav`}
        to="/services"
        activeClassName={s.active}
    >
      Панель
    </NavLink>
      )
    }
    
  }

  return (

    <header>
      {
        isLoggedIn ?
            <div className="header">
              <Container>
                <Row>
                  <ul>
                    


                    <li className={s.item}>
                      <NavLink
                          className={`nav`}
                          to="/cars"
                          activeClassName={s.active}
                      >
                        Машины
                      </NavLink>
                    </li>



                    <li className={s.item}>
                      {isAdmin()}
    
                    </li> 
                    

                    <li className={s.item}>
                      <NavLink
                          className={`nav`}
                          to="/review"
                          activeClassName={s.active}
                      >
                        Отзывы
                      </NavLink>
                    </li>
                    <li className={s.item}>
                      <NavLink className={`logo me-3 nav`} to="/main">
                        Yotor
                      </NavLink>
                    </li>
                    
                    <li className={s.item}>
                      <NavLink
                          className={` ${s.btn_online}`}
                          to="/online"
                          activeClassName={s.active}
                      >
                        Записаться онлайн
                      </NavLink>
                    </li>
                    <li className={s.item}>
                      <NavLink
                          className={` ${s.btn_join}`}
                          to="/cabinet"
                          activeClassName={s.active}
                      >
                        Личный кабинет
                      </NavLink>
                    </li>
                  </ul>
                </Row>
              </Container>
            </div>

            :

            <div className="header">
              <Container>
                <Row>
                  <ul> 
                    <li className={s.item}>
                        
                    
                  
                
                  </li>
                      
                    <li className={s.item} >
                      <NavLink
                          className={`nav`}
                          to="/review"
                          activeClassName={s.active}
                      >
                        Отзывы
                      </NavLink>
                    </li>
                    <li className={s.item}>
                      <NavLink className={`logo me-3 nav`} to="/main">
                        Yotor
                      </NavLink>
                    </li>
                    
                    <li className={s.item}>
                      <NavLink
                          className={` ${s.btn_online}`}
                          to="/online"
                          activeClassName={s.active}
                      >
                        Забронировать
                      </NavLink>
                    </li>
                    <li className={s.item}>
                      <NavLink
                          className={` ${s.btn_join}`}
                          to="/login"
                          activeClassName={s.active}
                      >
                        Войти
                      </NavLink>
                    </li>
                  </ul>
                </Row>
              </Container>
            </div>
      }

    </header>
  );
};

export default Header;
